import React, { Component } from 'react'
import {PageHeader} from 'react-bootstrap'


export default class MakeTeams extends Component {
 
  constructor(props){
    super(props);
    this.props.mainstate.players.map(player=>{
      switch(player.rating){
        case 1:
        this.setState({players1:[...player]})
          break;
        case 2:console.log("Rating2:"+player.value)
          break;
        case 3:console.log("Rating3:"+player.value)
          break;
        case 4:console.log("Rating4:"+player.value)
          break;
        case 5:console.log("Rating5:"+player.value)
          break;
        default:
          break;
      }
    })
  }
  
  render() {
   
    return (
      <div id="container">
         <PageHeader className="tracking-in-expand-fwd-top" style={{fontFamily: "'Alfa Slab One', cursive",color:"green",textShadow:"2px 2px lightgreen"}}>Make Teams</PageHeader> 
         
     
     
      </div>
    )
  }
}
